                    <ul className="filters__list">
                        {letterArray.map(() => {
                            return (
                                <li className="route__letter-item">
                                    <button className={`route__letter-button `}
                                        type="button"
                                        onClick={() => dispatch(setLetter(letter))}>{letter}
                                    </button>
                                </li>
